column3:
Thank you Chicago Tribune for this write up on Brujos! 

&quot;Creator Ricardo Gamboa (who also co-stars) calls the series a &quot;dark comedy and supernatural thriller that draws on telenovela forms but also shows like 'Charmed' and horror films of the '80s.&quot; Shot on the South Side (primarily Little Village), the first four episodes are available online. According to Gamboa, eight more episodes will be shot this summer and released in the fall, rounding out a 12-episode season.&quot;

#BrujosTV

&quot;Signature Move also shines a small, but much-needed light on non-white queer love. That, in and of itself is rare, because like the majority of Hollywood stories, the lesbian genre is typically filled with white girls, long hair, and too much makeup. Rarely, if ever, do queer women get to see films starring multi-dimensional Middle Eastern and Latina characters. It's a refreshing reminder that queerness not only lives, but thrives in all cultures.&quot;

Watch a short sneak peak of Signature Move with us on Sunday 3-5pm at Open TV Presents: Reality is Not Good Enough w/ Jennifer Reeder. We also have the privilege of having the director, Jennifer Reeder, in the house to have a Q&amp;A! 

See you there ❤️

&quot;So what is it about Chicago that engenders such distinct storytelling and production methods? &quot;I think every city has people who want intersectional programming, it's just that Chicago has some institutions that will actually support it and make space for it as well,&quot; says Aymar Jean Christian founder of Open TV. 

Unlike the large and competitive atmospheres of New York and LA, there's a communal sense of support across Chicago. &quot;Open TV's done probably 30 events in the city, and we've never really had a difficult time getting organizations to give us that space so we can program,&quot; Christian says.&quot;

Chicago is magical and so is Ashley Ray. Thank you so much for this great piece. We love youuuu &lt;3

This Sunday from 3-5pm join us for Open TV Presents: Reality is Not Good Enough w/ Jennifer Reeder. 

We will be screening Reality is Not Good Enough by Rashayla Marie Brown and a sneak peak of Signature Move directed by Jennifer Reeder and starring Fawzia Mirza. 

On Signature Move: &quot;A new romance with Alma forces Zaynab to confront her relationship with her recently widowed mother who escapes to TV dramas and finding her daughter a husband. In this coming-of-age Muslim melodrama, Zaynab copes by taking up Lucha-style wrestling.&quot;

Teen Vogue keeps getting better and better. 

&quot;It's no secret that pop culture has long been dominated by white, cis, and straight people. Only recently has a new generation of diverse, critically-acclaimed narratives paved the way for an industry that is very slowly letting QTPOC narratives shine, but, that said, we still need many more. Enter Brown Girls, the revolutionary, cult favorite web series giving a much-needed voice to queer millennials of color, specifically women.&quot;

#BrownGirlsTV
